import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import { HomeFillIcon } from '@primer/octicons-react';

function BreadCrumbNav({ pageName = "Page Name", link = "", linkName = "", }) {


    

    return (
        <>
            <div className="row bg-light">
                <Link className="m-1" to="/"><HomeFillIcon size={24} />Home</Link><p className="m-1"> / </p>
                {link === "" ? <p className="m-1">{pageName}</p> : " / " + <Link to={link}>{linkName}</Link> + <p className="m-1">{pageName}</p>}
            </div>
        </>
    );
}

export default BreadCrumbNav;
